import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { getAuth } from 'firebase/auth';
import { callService, clientService, categoryService } from '../../services/database';

function CallEntry() {
  const navigate = useNavigate();
  const auth = getAuth();
  const [clients, setClients] = useState([]);
  const [categories, setCategories] = useState([]);
  const [formData, setFormData] = useState({
    clientId: '',
    callType: 'inbound',
    patientId: '',
    summary: '',
    selectedCategories: [],
    timestamp: new Date().toISOString().slice(0, 16)
  });
  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const loadData = async () => {
      try {
        const [clientsData, categoriesData] = await Promise.all([
          clientService.getClients(),
          categoryService.getCategories()
        ]);
        setClients(clientsData);
        setCategories(categoriesData);
      } catch (error) {
        console.error('Error loading data:', error);
        setError('Error loading data. Please try again.');
      } finally {
        setLoading(false);
      }
    };

    loadData();
  }, []);

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError('');
    setSuccess('');

    try {
      // Validare de bazÄƒ
      if (!formData.clientId || !formData.patientId || !formData.summary) {
        throw new Error('Please fill in all required fields');
      }

      const callData = {
        ...formData,
        userId: auth.currentUser?.uid,
        categories: formData.selectedCategories
      };

      await callService.addCall(callData);
      setSuccess('Call entry saved successfully!');
      
      // Reset form
      setFormData({
        clientId: '',
        callType: 'inbound',
        patientId: '',
        summary: '',
        selectedCategories: [],
        timestamp: new Date().toISOString().slice(0, 16)
      });

      // Redirect to dashboard after 2 seconds
      setTimeout(() => {
        navigate('/');
      }, 2000);

    } catch (error) {
      setError(error.message);
    }
  };

  const handleCategoryChange = (categoryId) => {
    setFormData(prev => ({
      ...prev,
      selectedCategories: prev.selectedCategories.includes(categoryId)
        ? prev.selectedCategories.filter(id => id !== categoryId)
        : [...prev.selectedCategories, categoryId]
    }));
  };

  if (loading) {
    return (
      <div className="min-h-screen flex items-center justify-center">
        <div className="text-lg">Loading...</div>
      </div>
    );
  }

  return (
    <div className="min-h-screen bg-gray-100 py-6 flex flex-col justify-center sm:py-12">
      <div className="relative py-3 sm:max-w-xl sm:mx-auto">
        <div className="relative px-4 py-10 bg-white mx-8 md:mx-0 shadow rounded-3xl sm:p-10">
          <div className="max-w-md mx-auto">
            <div className="flex items-center space-x-5">
              <div className="block pl-2 font-semibold text-xl text-gray-700">
                <h2 className="leading-relaxed">New Call Entry</h2>
              </div>
            </div>
            <form onSubmit={handleSubmit} className="divide-y divide-gray-200">
              <div className="py-8 text-base leading-6 space-y-4 text-gray-700 sm:text-lg sm:leading-7">
                {error && (
                  <div className="bg-red-50 p-4 rounded-md">
                    <div className="text-sm text-red-700">{error}</div>
                  </div>
                )}
                {success && (
                  <div className="bg-green-50 p-4 rounded-md">
                    <div className="text-sm text-green-700">{success}</div>
                  </div>
                )}

                <div className="flex flex-col">
                  <label className="leading-loose">Client</label>
                  <select
                    value={formData.clientId}
                    onChange={(e) => setFormData({ ...formData, clientId: e.target.value })}
                    className="px-4 py-2 border focus:ring-indigo-500 focus:border-indigo-500 w-full sm:text-sm border-gray-300 rounded-md focus:outline-none text-gray-700"
                    required
                  >
                    <option value="">Select a client</option>
                    {clients.map(client => (
                      <option key={client.id} value={client.id}>
                        {client.name}
                      </option>
                    ))}
                  </select>
                </div>

                <div className="flex flex-col">
                  <label className="leading-loose">Call Type</label>
                  <select
                    value={formData.callType}
                    onChange={(e) => setFormData({ ...formData, callType: e.target.value })}
                    className="px-4 py-2 border focus:ring-indigo-500 focus:border-indigo-500 w-full sm:text-sm border-gray-300 rounded-md focus:outline-none text-gray-700"
                  >
                    <option value="inbound">Inbound</option>
                    <option value="outbound">Outbound</option>
                  </select>
                </div>

                <div className="flex flex-col">
                  <label className="leading-loose">Patient ID/Initials</label>
                  <input
                    type="text"
                    value={formData.patientId}
                    onChange={(e) => setFormData({ ...formData, patientId: e.target.value })}
                    className="px-4 py-2 border focus:ring-indigo-500 focus:border-indigo-500 w-full sm:text-sm border-gray-300 rounded-md focus:outline-none text-gray-700"
                    required
                  />
                </div>

                <div className="flex flex-col">
                  <label className="leading-loose">Call Summary</label>
                  <textarea
                    value={formData.summary}
                    onChange={(e) => setFormData({ ...formData, summary: e.target.value })}
                    rows="4"
                    className="px-4 py-2 border focus:ring-indigo-500 focus:border-indigo-500 w-full sm:text-sm border-gray-300 rounded-md focus:outline-none text-gray-700"
                    required
                  />
                </div>

                <div className="flex flex-col">
                  <label className="leading-loose">Categories</label>
                  <div className="grid grid-cols-2 gap-2">
                    {categories.map(category => (
                      <label key={category.id} className="inline-flex items-center">
                        <input
                          type="checkbox"
                          checked={formData.selectedCategories.includes(category.id)}
                          onChange={() => handleCategoryChange(category.id)}
                          className="form-checkbox h-4 w-4 text-indigo-600"
                        />
                        <span className="ml-2 text-gray-700">{category.label}</span>
                      </label>
                    ))}
                  </div>
                </div>

                <div className="flex flex-col">
                  <label className="leading-loose">Timestamp</label>
                  <input
                    type="datetime-local"
                    value={formData.timestamp}
                    onChange={(e) => setFormData({ ...formData, timestamp: e.target.value })}
                    className="px-4 py-2 border focus:ring-indigo-500 focus:border-indigo-500 w-full sm:text-sm border-gray-300 rounded-md focus:outline-none text-gray-700"
                  />
                </div>
              </div>
              <div className="pt-4 flex items-center space-x-4">
                <button
                  type="button"
                  onClick={() => navigate('/')}
                  className="flex justify-center items-center w-full text-gray-900 px-4 py-3 rounded-md focus:outline-none"
                >
                  <svg className="w-6 h-6 mr-3" fill="none" stroke="currentColor" viewBox="0 0 24 24" xmlns="http://www.w3.org/2000/svg">
                    <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M6 18L18 6M6 6l12 12"></path>
                  </svg> Cancel
                </button>
                <button
                  type="submit"
                  className="bg-indigo-600 flex justify-center items-center w-full text-white px-4 py-3 rounded-md focus:outline-none hover:bg-indigo-700"
                >
                  Save Call Entry
                </button>
              </div>
            </form>
          </div>
        </div>
      </div>
    </div>
  );
}

export default CallEntry;
